import express from "express";
import { selectSql, deleteSql } from "../database/sql";

const router = express.Router();

// department와 lecture의 정보를 모두 가져온다. 
// 이후 재목과 각 table의 정보를 hbs에 연결해준다. 
router.get('/', async function(req, res) {
    const airport = await selectSql.getAirport(); 
    // const flight = await selectSql.getFlight();
    // const flightleg = await selectSql.getFlightLeg();
    const airplane = await selectSql.getAirplane();
    const legin = await selectSql.getLegIn();
    res.render('admin', {
        title: '관리자 삭제 페이지',
        title1: 'Airport 정보',
        // title2: 'Flight 정보',
        // title3: 'Flight_Leg 정보',
        title4: 'Airplane 정보',
        title5: 'Leg_Instance 정보',
        airport,
        // flight,
        // flightleg,
        airplane,
        legin,
    });    
});

// post를 통해서 버튼 입력에 따른 행동을 정해준다. 
// department만 있었던 때와 다르게 Lname과 Dnumber를 모두 받아오게 만들고
// 둘중에 undefined 인 것을 구별해서 deleteSql을 다르게 적용했다. 
router.post('/', async (req,res)=>{
    console.log('admin router:', req.body.delAirBtn);
    // console.log('admin router:', req.body.delFliBtn);
    // console.log('admin router:', req.body.delFliLeBtn);
    console.log('admin router:', req.body.delLegInBtn);
    console.log('admin router:', req.body.delPlaneBtn);
